Method.Source:
    [Form]
    public class PurchAgreementInvoiceJournal extends FormRun
    {
        InventDimCtrl_Frm_Mov   inventDimFormSetup;
}

public Common docCursor()
{
    Common docCursor;

    docCursor = super();

    if (docCursor.TableId == tableNum(InventDim))
    {
        docCursor = vendInvoiceTrans;
    }

    return docCursor;
}

/// <summary>
/// Gets the Inventory Dimensions Form Setup object.
/// </summary>
/// <returns>
/// Inventory Dimensions Form Setup object.
/// </returns>
Object inventDimSetupObject()
{
    return inventDimFormSetup;
}

void updateDesign(InventDimFormDesignUpdate mode)
{
    PurchLine       purchLine;
    InventMovement  movement = InventMovement::construct(purchLine);

    switch (mode)
    {
        case InventDimFormDesignUpdate::Init        :
            if (!inventDimFormSetup)
            {
                inventDimFormSetup  = InventDimCtrl_Frm_Mov::newFromFormMovement(element, movement);
            }
            break;
        case InventDimFormDesignUpdate::Active      :
            inventDimFormSetup.formActiveSetup(movement.inventDimGroupSetup(), movement);
            inventDimFormSetup.formSetControls(true);
            break;

        case InventDimFormDesignUpdate::FieldChange :
            inventDimFormSetup.formActiveSetup(movement.inventDimGroupSetup(), movement);
            inventDimFormSetup.formSetControls(false);
            break;

        default : throw error(strFmt("@SYS54195", funcName()));
    }
}

public void init()
{
    QueryBuildDataSource    qbds;
    QueryBuildDataSource    qbdsAgreementLineReleasedLine;
    QueryBuildDataSource    qbdsAgreementLine;

    super();

    qbds = vendInvoiceTrans_ds.query().dataSourceTable(tableNum(VendInvoiceTrans));
    qbds.clearDynalinks();
    qbdsAgreementLineReleasedLine = qbds.addDataSource(tableNum(AgreementLineReleasedLine));
    qbdsAgreementLineReleasedLine.joinMode(JoinMode::ExistsJoin);
    qbdsAgreementLineReleasedLine.addLink(fieldNum(VendInvoiceTrans, RecId),
                                fieldNum(AgreementLineReleasedLine, VendInvoiceTrans));

    switch (element.args().dataset())
    {
        case tableNum(PurchAgreementHeader):
            qbdsAgreementLine = qbdsAgreementLineReleasedLine.addDataSource(tableNum(AgreementLine));
            qbdsAgreementLine.joinMode(JoinMode::ExistsJoin);
            qbdsAgreementLine.addLink(fieldNum(AgreementLineReleasedLine, AgreementLine),
                               fieldNum(AgreementLine, RecId));
            qbdsAgreementLine.clearDynalinks();
            qbdsAgreementLine.relations(true);
            qbdsAgreementLine.addDynalink(fieldNum(AgreementLine, Agreement),
                                   element.args().record(),
                                   fieldNum(PurchAgreementHeader, RecId));
            break;
        case tableNum(AgreementLine):
            qbdsAgreementLineReleasedLine.addDynalink(fieldNum(AgreementLineReleasedLine, AgreementLine),
                                            element.args().record(),
                                            fieldNum(AgreementLine, RecId));
            break;
    }
}
